function D2D_Audio(a){this.audio=new Audio(a);this.audio.loop=false;}D2D_Audio.prototype.play=function(){this.audio.play();};D2D_Audio.prototype.pause=function(){this.audio.pause();};D2D_Audio.prototype.stop=function(){this.audio.pause();if(this.audio.readyState==4){this.audio.currentTime=0;}};D2D_Audio.prototype.reload=function(a){this.audio.src=a;this.audio.load();};D2D_Audio.prototype.setVolume=function(a){this.audio.volume=a;};D2D_Audio.prototype.getVolume=function(){return this.audio.volume;};D2D_Audio.prototype.isLoop=function(){return this.audio.loop;};D2D_Audio.prototype.setLoop=function(a){this.audio.loop=a;};D2D_Audio.prototype.getTotalTime=function(){return this.audio.duration;};D2D_Audio.prototype.getCurrentTime=function(){return this.audio.currentTime;};D2D_Audio.prototype.setCurrentTime=function(a){this.audio.currentTime=a;};D2D_Audio.prototype.getSpeed=function(){return this.audio.playbackRate;};D2D_Audio.prototype.setSpeed=function(a){this.audio.playbackRate=a;};D2D_Audio.prototype.isPlaying=function(){return(this.audio.paused==false);};D2D_Audio.prototype.isReady=function(){return(this.audio.readyState==4);};D2D_Audio.prototype.getReadyStateCode=function(){return this.audio.readyState;};D2D_Audio.prototype.getReadyState=function(){if(this.audio.readyState==0){return"HAVE_NOTHING";}else{if(this.audio.readyState==1){return"HAVE_METADATA";}else{if(this.audio.readyState==2){return"HAVE_CURRENT_DATA";}else{if(this.audio.readyState==3){return"HAVE_FUTURE_DATA";}else{if(this.audio.readyState==4){return"HAVE_ENOUGH_DATA";}else{return"READY_STATE_ERROR";}}}}}};D2D_Audio.prototype.dispose=function(){this.audio.pause();this.audio=null;};